import React from 'react';
import { Link } from 'react-router-dom';

export default function BtnRender({product}) {
    return (
        <div className="row_btn">
                <Link id="btn_buy" to="#!">Buy</Link>
                <Link id="btn_view" to={`/detail/${product._id}`}>View</Link>
        </div>
    )
}
